import React from 'react';
import { Container } from 'semantic-ui-react';
import Header from './Header';

export default props => {
  return (
    <div stylesheet={{ padding:'10%' }}>
      <Container>
        <Header/>
        { props.children }
      </Container>
    </div>
  );
};
